function calcShift(h, w) {
  const step1 = (h * w) / 256;
  const step2 = (1.15 - 0.5) / (4096 - 256);
  const step3 = (step1 - 256) * step2;
  const step4 = step3 + 0.5;
  const result = Math.exp(step4);
  return Math.round(result * 100) / 100;
}

